import React from 'react';

import home from '../assets/home.png';
import game_icon from '../assets/game_icon.png';
import automobiles from '../assets/automobiles.png';
import sports from '../assets/sports.png';
import entertainment from '../assets/entertainment.png';
import tech from '../assets/tech.png';
import music from '../assets/music.png';
import blogs from '../assets/blogs.png';
import SidebarComponents from './SidebarComponents';
import pew from '../assets/pew.jpg'
import aw from '../assets/aw.jpg'
import dp from '../assets/dp.jpg'
import mb from '../assets/mb.jpg'
import SidebarComponentsSub from './sidebarComponentsSub';

const Sidebar = ({isCollapsed, Category, setCategory}) => {
  return (
    <div className={` bg-white py-4   transition-all duration-300 hide-scrollbar overflow-y-auto flex-shrink-0 border-r ${isCollapsed? 'w-16 h-full': 'w-64 h-screen'}`}>
      {!isCollapsed ?
        (
        <div className="flex flex-col">
    <div className="flex flex-col space-y-1 mb-4">
          
          <SidebarComponents icon={home} label="Home"  onClick={()=>setCategory(0)} />
          <SidebarComponents icon={game_icon} label="Gaming"  onClick={()=>setCategory(20)}/>
      <SidebarComponents icon={automobiles} label="Automobiles"  onClick={()=>setCategory(2)}/>
      <SidebarComponents icon={sports} label="Sports" onClick={()=>setCategory(17)} />
      <SidebarComponents icon={entertainment} label="Entertainment" onClick={()=>setCategory(24)}/>
      <SidebarComponents icon={tech} label="Technology" onClick={()=>setCategory(28)}/>
      <SidebarComponents icon={music} label="Music" onClick={()=>setCategory(10)}/>
      <SidebarComponents icon={blogs} label="Blogs" onClick={()=>setCategory(22)}/>
          
          <hr className='my-2'/>
        </div>
        <div className="subscriber-list mt-4" >
            <span className='font-semibold text-sm text-gray-600 px-4 mb-2 block'>Subscriptions</span>
            <SidebarComponentsSub icon={pew} label="Pewdiepie"/>
            <SidebarComponentsSub icon={aw} label="Alan Walker"/>
            <SidebarComponentsSub icon={dp} label="Dude Perfect"/>
            <SidebarComponentsSub icon={mb} label="MrBeast"/>
        
          
        </div>
      </div>
  ):(
    <div className="flex flex-col">
    <div className="flex flex-col space-y-1 mb-4">
          
          <SidebarComponents icon={home} label="" />
          <SidebarComponents icon={game_icon} label="" />
      <SidebarComponents icon={automobiles} label="" />
      <SidebarComponents icon={sports} label="" />
      <SidebarComponents icon={entertainment} label="" />
      <SidebarComponents icon={tech} label="" />
      <SidebarComponents icon={music} label="" />
      <SidebarComponents icon={blogs} label="" />
          
          <hr className='my-2'/>
        </div>
        
      </div>
  )
      }
  
    </div>
  );
};

export default Sidebar;
